import React from 'react';
import '../styles/Interests.css';

const Interests: React.FC = () => {
  const interests = [
    {
      title: "Traveling",
      description: "Exploring new places, cultures, and cuisines.",
      detail: "Favorite Destinations: Japan, Italy, and New Zealand.",
    },
    {
      title: "Photography",
      description: "Capturing moments through the lens.",
      detail: "Specializes in landscapes and urban photography.",
    },
    {
      title: "Technology",
      description: "Keeping up with the latest tech trends.",
      detail: "Big fan of AI advancements and smart gadgets.",
    },
    {
      title: "Gaming",
      description: "Strategy, adventure, and RPG games.",
      detail: "Favorite games: The Witcher, Zelda, and Civilization VI.",
    },
    {
      title: "Reading",
      description: "Diving into books about history and science.",
      detail: "Currently reading: 'Sapiens' by Yuval Noah Harari.",
    },
    {
      title: "Fitness",
      description: "Staying active with hiking and outdoor sports.",
      detail: "Loves early morning runs and mountain treks.",
    },
  ];

  return (
    <section id="interests" className="interests-section">
      <h2>My Interests</h2>
      <p>Hover over each card to learn more about my hobbies and passions!</p>
      <div className="interests-grid">
        {interests.map((interest, index) => (
          <div key={index} className="interest-card">
            <div className="card-front">
              <h3 className="interest-title">{interest.title}</h3>
              <p className="interest-description">{interest.description}</p>
            </div>
            <div className="card-back">
              <p className="interest-detail">{interest.detail}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Interests;
